import React, { useEffect, useState } from 'react';
import api from '../api';
import './styles/ProductList.css';


const ProductList = () => {
    const [produse, setProduse] = useState([]);

    useEffect(() => {
        api.get('/produse')
            .then((response) => setProduse(response.data))
            .catch((error) => console.error('Eroare la încărcarea produselor:', error));
    }, []);

    return (
        <div>
            <h1>Produse Disponibile</h1>
            <ul>
                {produse.map((produs) => (
                    <li key={produs.id}>
                        <h3>{produs.nume}</h3>
                        <p>Preț: {produs.pret} RON</p>
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default ProductList;
